;; gorilla-repl.fileformat = 1

;; **
;;; # n-factors
;;; 
;;; [Lee Spector](http://hampshire.edu/lspector), [lspector@hampshire.edu](mailto:lspector@hampshire.edu), `20180210`
;;; 
;;; In this worksheet I play with some code related to factoring, demonstrating a few features of Clojure and eventually using evolution to find numbers with specified numbers of factors.
;;; 
;;; First, I'll create the namespace:
;; **

;; @@
(ns n-factors)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Next, let's define a function that tells us whether one number evenly divides another:
;; **

;; @@
(defn evenly-divides?
  "Returns true if n evenly divides m, or false otherwise."
  [n m]
  (= 0 (mod m n)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;n-factors/evenly-divides?</span>","value":"#'n-factors/evenly-divides?"}
;; <=

;; **
;;; And let's test it out:
;; **

;; @@
(evenly-divides? 9 99)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>true</span>","value":"true"}
;; <=

;; @@
(evenly-divides? 9 100)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>false</span>","value":"false"}
;; <=

;; **
;;; We can use `evenly-divides` to write `factors`, which returns all of the factors of a given number. I'll do this here by using `range` to create a collection of all of the numbers from 1 up to the number, and then `filter`ing the result of that, retaining only those that evenly divide the given number:
;; **

;; @@
(defn factors
  "Returns all of the factors of integer n."
  [n]
  (filter #(evenly-divides? % n)
          (range 1 (inc n))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;n-factors/factors</span>","value":"#'n-factors/factors"}
;; <=

;; **
;;; Let's try it on 99:
;; **

;; @@
(factors 99)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-long'>1</span>","value":"1"},{"type":"html","content":"<span class='clj-long'>3</span>","value":"3"},{"type":"html","content":"<span class='clj-long'>9</span>","value":"9"},{"type":"html","content":"<span class='clj-long'>11</span>","value":"11"},{"type":"html","content":"<span class='clj-long'>33</span>","value":"33"},{"type":"html","content":"<span class='clj-long'>99</span>","value":"99"}],"value":"(1 3 9 11 33 99)"}
;; <=

;; **
;;; Now if we just want the *number* of factors, not all of the factors themselves, then we can wrap a call to `factors` in a call to `count`. Let's define a function that does this, since we'll want to do it a lot:
;; **

;; @@
(defn count-factors 
  "Returns the number of distinct factors of the integer n."
  [n]
  (count (factors n)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;n-factors/count-factors</span>","value":"#'n-factors/count-factors"}
;; <=

;; **
;;; And let's try it:
;; **

;; @@
(count-factors 99)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>6</span>","value":"6"}
;; <=

;; **
;;; Now let's try it on all of the numbers from 1 to 100:
;; **

;; @@
(map count-factors (range 1 101))
