;; **
;;; How big does the number of factors get in that range? It's a bit of a pain to look at all those numbers by eye, but we can instead just apply `max` to the collection:
;; **

;; @@
(apply max (map count-factors (range 1 1001)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>32</span>","value":"32"}
;; <=

;; **
;;; How big does it get if we go up to 2000?
;; **

;; @@
(apply max (map count-factors (range 1 2001)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>40</span>","value":"40"}
;; <=

;; **
;;; Okay, so some number in the first 2000 has 40 factors... but is that rare? Are there numbers with every number of factors up to 40 in those first 2000 numbers? The `frequencies` function is a cool way to look at this:
;; **

;; @@
(frequencies (map count-factors (range 1 2001)))
