;; **
;;; The `frequencies` function returns a map in which each item in the collection that it was given is a key, for which the value is the number of times that item occurs in the collection. So 7 is the number of factors of 2 numbers in the collection. 20 is the number of factors of 27 of the numbers, etc.
;;; 
;;; That's a little hard to read, though, because it's in no particular order. Maps aren't intrinsically ordered, and Clojure allows itself to print them in whatever order is easiest or most efficient for the system.
;;; 
;;; If we want to see it in order, then we can just wrap that in a call to `sort`:
;; **

;; @@
(sort (frequencies (map count-factors (range 1 2001))))
