;; **
;;; If you actually ran that, then you will have noticed something odd. It immediately printed the message about using a tiny fraction of a millisecond, but then it paused before printing the result.
;;; 
;;; This demonstrates something that you have to watch out for whenever you try to time things that use lazy sequences.
;;; 
;;; That tiny fraction of a second was all that was needed to *create* the lazy sequence, but because it's lazy, none of its elements will actually have been calculated at that point. They're only calculated when needed, which in this case is just when, *after we're done timing*, the REPL needs the full result in order to print it.
;;; 
;;; To get the time needed to calculate the whole thing, we can call `doall` on the sequence within the call to `time`:
;; **

;; @@
(time (doall (map count-factors (range 1 4001))))
;; @@
