;; **
;;; There we see it takes most of a second, on the machine I'm using now, to calculate the full thing.
;;; 
;;; Now there are probably *many* ways in which the efficiency of `count-factors` could be improved. For example, if you know that *n* is a factor of *m*, then you also already know that all of *n*'s factors are also factors of *m*, without actually testing them. You could do a lot of clever stuff.
;;; 
;;; Here, though, I just want to do something much simpler, which happens to be remarkably easy to do in Clojure so you may want to remember it.
;;; 
;;; The idea, called "memoization", involves making a function remember all the results it has ever given before. And you make it look for a stored result first whenver you call it. If you call it again with the same arguments, it just returns the same result it gave last time, without recalculating anything.
;;; 
;;; You can probably imagine how you would do this in whatever other programming languages you've used before, setting up a table that gets stored outside of the function, and searching in it on every call, etc. It would be a bit of work and create a fair bit of clutter, along with opportunities to make mistakes. Depending on the language you might also have to worry about storage allocation, etc.
;;; 
;;; But in Clojure, we can create a memoized version of `factors`, which we'll call `mfactors`,  just like this:
;; **

;; @@
(def mfactors (memoize factors))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;n-factors/mfactors</span>","value":"#'n-factors/mfactors"}
;; <=

;; **
;;; Now we can use `mfactors` anywhere we would have used `factors`, and it'll produce the same results, but it will never calculate a result more than once.
;;; 
;;; Now let's define a version of `count-factors` that uses `mfactors` instead of `factors`:
;; **

