;; **
;;; Now let's try to use evolution to find a number that has a particular number of factors.
;;; 
;;; Evolution (of the computational kind that we'll be discussing here!) involves a loop of testing, selection, and variation. 
;;; 
;;; While you could implement the loop in various ways in Clojure, we'll use the explicit `loop` structure here, which I think makes the concepts pretty clear.
;;; 
;;; However, whenever you use an explicit loop, it's pretty easy to accidentally create an infinite one. And Gorilla REPL doesn't handle infinite loops very well. So before you evaluate any loop-based code you should be sure to save your worksheet. If you do enter an infinite loop, then you should still be able to save at that point, but after that, to continue working, you'll have to close your browser window, kill your `lein` process by typing control-c in your Terminal (command line interface), restart lein (`lein gorilla`), open the URL in your browser, and re-load your worksheet. (Ugh.)
;;; 
;;; So, a quick tutorial on `loop`:
;;; 
;;; Following the word `loop` you have a vector of loop variables and their initial values. The body of the loop should usually either be entirely or end with a conditional expression that figures out if you're done looping, and if so, says what to return. If you're not done looping, then you want to `recur` to the top of the loop with new values for the loop variables. Your call to `recur` has to have the same number of arguments as you have loop variables.
;;; 
;;; For example:
;; **

;; @@
(loop [n 1]           ;; We have one loop variable, called n, with initial value 1
  (if (> n 10)        ;; If n is greater than 10
    (* n n)           ;;   then we're done and we return n squared
    (recur (* 2 n)))) ;; Else we go back to the top with twice n being the new n
;; @@
