;;; That returned 256 because the first time `n` was greater than 10 it was actually 16, because it's doubling each time through.
;;; 
;;; We can see this by adding some printing to the loop:
;; **

;; @@
(loop [n 1]
  (println n)
  (if (> n 10)
    (* n n)
    (recur (* 2 n))))
;; @@
;; ->
;;; 1
;;; 2
;;; 4
;;; 8
;;; 16
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-long'>256</span>","value":"256"}
;; <=

;; **
;;; Here's a version of that loop that, instead of printing everything the history of `n`, keeps track of it in a second loop variable, and then returns a map showing the final answer and the history:
;; **

;; @@
(loop [n 1                             ;; Loop variable n starts as 1
       history []]                     ;; Loop variable history starts as []
  (if (> n 10)                         ;; If n is more than 10
    {:answer (* n n) :history history} ;;   then return a map with an answer and the history
    (recur (* 2 n)                     ;; else recur with double n for the new n
           (conj history n))))         ;;   and with this n added to the history
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-map'>{</span>","close":"<span class='clj-map'>}</span>","separator":", ","items":[{"type":"list-like","open":"","close":"","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:answer</span>","value":":answer"},{"type":"html","content":"<span class='clj-long'>256</span>","value":"256"}],"value":"[:answer 256]"},{"type":"list-like","open":"","close":"","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:history</span>","value":":history"},{"type":"list-like","open":"<span class='clj-vector'>[</span>","close":"<span class='clj-vector'>]</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-long'>1</span>","value":"1"},{"type":"html","content":"<span class='clj-long'>2</span>","value":"2"},{"type":"html","content":"<span class='clj-long'>4</span>","value":"4"},{"type":"html","content":"<span class='clj-long'>8</span>","value":"8"}],"value":"[1 2 4 8]"}],"value":"[:history [1 2 4 8]]"}],"value":"{:answer 256, :history [1 2 4 8]}"}
