;; **
;;; Okay, so we'll do evolution with a loop something like that, in a few minutes, to try to evolve numbers with particular numbers of factors.
;;; 
;;; First, though, we need a function that we'll use to test how good a number is. We'll phrase it as an "error" function, which means that we'll make it return 0 for a perfect number (with exactly the right number of factors), and higher numbers (error!) if it has the wrong number of factors.
;;; 
;;; You could do this in various ways, and designing the error function (sometimes called the "fitness function") is part of the art of using evolutionary computation effectively.
;;; 
;;; Here I've chosen to do something a little odd, which may or may not turn out to be a good idea: I've made an error function that always gives a higher error for having *too few* factors than for having *too many* factors. Within each of those categories, it gives a lower error the closer the number of factors is to being correct:
;; **

;; @@
(defn n-factors-error
  "Returns zero if n has the target number of factors. If n has too few factors,
  then this returns the difference between the number of factors and the target. 
  If n has too many factors, then this returns the difference shrunken into the
  range between 0 and 1, so that the error will always be less than that for
  having too few factors."
  [target n]
  (let [facs (count-mfactors n)]
    (cond (= facs target) 0
          (< facs target) (- target facs)
          :else (- 1.0 (/ 1 (inc (- facs target)))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;n-factors/n-factors-error</span>","value":"#'n-factors/n-factors-error"}
;; <=

;; **
;;; To try this out, let's consider the number 180, which has 18 factors:
;; **

;; @@
(count-mfactors 180)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>18</span>","value":"18"}
;; <=

;; **
;;; Suppose our target is to find a number with 20 factors. Then 180 has too few factors, and we should get an error value that tells us how far off it is:
;; **

;; @@
(n-factors-error 20 180)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-long'>2</span>","value":"2"}
;; <=

;; **
;;; That looks right. 
;;; 
;;; But suppose are target is to find a number with only 13 factors. Then 180, with 18 factors, is 5 off, but it has too many rather than too few, so the error will be lower:
;; **

;; @@
(n-factors-error 13 180)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>0.8333333333333333</span>","value":"0.8333333333333333"}
;; <=

;; **
;;; The next thing we need is a way to "vary" a number to produce a child number.
;;; 
;;; This could also be done in many ways, possibly combining pairs (or triples, etc.) of parents to produce a single child, etc.
;;; 
;;; But here we'll just do something simple that takes a single parent and tweaks it in a random way, with the specific tweaks just being things I came up with by messing around (there might be something much better!):
;; **

;; @@
(defn tweak 
  "Returns n randomly adjusted by being added, subtracted, or multiplied 
  with a factor of itself along with 1 or 2. If the result would exceed 
  a limit of 1000000, then a random number less than 1000000 is returned 
  instead. If the result would be less than 1, than a random number between
  1 and 5 is returned instead."
  [n]
  (let [limit 1000000
        adjustment (rand-nth [1 2])
        adjusting-function (rand-nth [+ - *])
        raw-result (adjusting-function n (rand-nth (mfactors n)) adjustment)]
    (if (< raw-result limit)
      (if (< raw-result 1)
        (inc (rand-int 5))
        raw-result)
      (inc (rand-int (dec limit))))))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;n-factors/tweak</span>","value":"#'n-factors/tweak"}
;; <=

;; **
;;; Let's try it out:
;; **

;; @@
(tweak 10)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-long'>7</span>","value":"7"}
;; <=

;; @@
(tweak 10)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-long'>100</span>","value":"100"}
;; <=

;; @@
(sort (frequencies (repeatedly 100 #(tweak 100))))
