;; **
;;; Okay, now we can write a function that implements an evolutionary loop.
;;; 
;;; Our function will take arguments for the population size, the maximum number of generations to run, and the target number of factors.
;;; 
;;; In the function, we'll use `let` to bind a symbol to the error function, which will be a memoized function that calls `n-factors-error` with the target and the number being tested.
;;; 
;;; Then we'll enter a loop with two loop variables, one of which will hold the generation number, and the other of which will hold the population, which will initially just be random numbers. We'll always keep the population sorted by error, with the best numbers first.
;;; 
;;; In the body of the loop we'll print a bunch of stuff and then test to see if we've succeeded (that is, found something with zero error). If so then we'll return a success message and be done. 
;;; 
;;; Otherwise, we'll test to see if we've hit the maximum number of generations, in which case we'll return a failure message and be done.
;;; 
;;; If neither of those things happen then we'll recur, with an increased generation number and with a new population that results from tweaking selected numbers from the current population, and sorting the resulting numbers by error. The way that we'll select parents is to pick one randomly from a collection that contains the full population but then also the first half (the better numbers) a second time, so that the better numbers will have a higher chance of being selected.
;;; 
;; **

;; @@
(defn evolve-with-factors
  "Attempts to evolve a number with the target number of factors."
  [pop-size max-gens target]
  (let [error (memoize #(n-factors-error target %))]
    (loop [gen 0
           pop (sort-by error (repeatedly pop-size #(inc (rand-int 100))))]
      (println "gen:" gen)
      (println "pop:" pop)
      (println "errors:" (map error pop))
      (println "----------------------------------- BEST: " (error (first pop)))
      (if (zero? (error (first pop)))
        (str "success at generation " gen)
        (if (>= gen max-gens)
          "failure"
          (recur (inc gen)
                 (let [pool (take (* pop-size 3/2) (cycle pop))]
                   (sort-by error (repeatedly pop-size #(tweak (rand-nth pool)))))))))))
